import React from 'react';
import video from '../assets/Images/Home_vid.mp4';

const Home = () => {
  return (
    <div style={{ position: 'relative', width: '100%', height: '100vh', display: 'flex', alignItems: 'center' }}>
      <div style={{ position: 'absolute', top: '50%', transform: 'translateY(-50%)', textAlign: 'center', color: 'beige', fontFamily: 'AbrilFatface-Regular', marginLeft: '20px' }}>
        <h1>Welcome to Pillar Watch</h1>
        <p>Discover the latest in Pillar watches.</p>
      </div>
      <video
        title="Pillar Watch Video"
        style={{ position: 'absolute', width: '100%', height: '100%', top: 0, left: 0, objectFit: 'cover' }}
        autoPlay
      >
        <source src={video} type="video/mp4" />
      </video>
    </div>
  );
};

export default Home;
